import Navbar from './Content/Navbar.js';
import Home from './Content/Home.js';
import About from './Content/About.js';
import Skills from './Content/Skills.js';
function App() {
  return (
    <div className="App">
      <Navbar/>
      <Home/>
      <About/>
      <Skills/>
    </div>
  );
}

export default App;
